  \"2013-03-14T15:03:44.658188\",\n\t\"name\": \"fema-dfirm-web-map-service\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"FEMA provides access to the National Flood
  Hazard Layer through a Web Map Service. The National Flood Hazard Layer is a computer
  database that contains FEMA's flood hazard map data. The data depict flood hazard
  information and supporting data used to develop the information. The primary hazard
  classifications are the 1 percent-annual-chance flood event, the 0.2 percent-annual-chance
  flood event, and areas of minimal flood hazard. Flood hazard and supporting data
  are developed using specifications for horizontal control consistent with 1:12,000-scale
  mapping. If you plan to display maps from the National Flood Hazard Layer with other
  map data for official purposes, ensure that the other information meets FEMA's standards
  for map accuracy. The NFHL data are from FEMA's Digital Flood Insurance Rate Map
  (DFIRM) databases. New data are added continually. The NFHL also contains changes
  to DFIRM data made by Letters of Map Revision (LOMRs). The service provides map
  images geo-referenced to the earth's surface using the North American Datum of 1983,
  Geodetic Reference System 80 coordinate system.\",\n\t\"license_title\": null,\n\t\"extras\":
